import React from "react";
import { useNavigate } from "react-router-dom"; 

function paymentpage (){
    const navigate = useNavigate()

    const success =()=>{
        navigate('/success')
    }
    return(
        <div style={{border:"2px solidblack",borderRadius:"5px",width:"500px",height:"350px"}}>
            <button onClick={{success}}>Pay</button>
        </div>
    )
}
export default paymentpage;
